import "./App.css";
import { useState } from "react";
import {SendMessage} from './message';
import {Tetst} from './tetst';

function App() {
  const [messageList, setMessage] = useState([]);

  return (
    <div className="App">
      <h1>
        <SendMessage setMessage={setMessage} />
        {messageList.map((e) => (
          <div key={value}>{e}</div>
        ))}
        <Tetst defaultNumber={0}/>
      </h1>

      <header className="App-header">
        <div className="block">
        </div>
      </header>
    </div>
  );
}

export default App;
